%[text] Te
%[text] 1\.0
%[text]         4\.4580001831         0.0000000000         0.0000000000
%[text]        \-2.2290000916         3.8607414086         0.0000000000
%[text]         0\.0000000000         0.0000000000         5.9250001907
%[text]    Te
%[text]     3
%[text] Direct
%[text]      0\.745000000         0.000000000         0.333333343
%[text]      0\.000000000         0.745000000         0.666666677
%[text]      0\.255000000         0.255000000         0.000000000
%[text] ![](text:image:7f06)Space Group Number: 152 Point Group: 18 \[ D3 \] International: P3\_121
%[text] ![](text:image:640e)
%[text] DFT(vasp5.4.4 with patch: [https://github.com/Chengcheng-Xiao/VASP2WAN90\_v2\_fix)](https://github.com/Chengcheng-Xiao/VASP2WAN90_v2_fix))
%[text] 
cd DFT/

EIGENCAR = EIGENVAL_read;
Ecut = [-6, 6]; 

%
%[PROCAR_collection,EIGENCAR] = PROCAR_read('SOC_flag',1);

[WEIGHTCAR_struct_cell, Name_list, ~] = WEIGHTCAR_read_dir('PBAND'); %[output:6e21d842]
WEIGHTCAR_struct_Te = WEIGHTCAR_struct_cell{1}(2:4);  
titlestring = 'fatband-Te-soc'; 

% Generate band plot
%%
[fig,Ax] = Figs(1,2); %[output:7655ffe7]
bandplot(EIGENCAR,Ecut,'Color','r','ax',Ax(1)); %[output:7655ffe7]
[fig, ax] = pbandplot(WEIGHTCAR_struct_Te, EIGENCAR,... %[output:7655ffe7]
    'Ecut', Ecut,... %[output:7655ffe7]
    'title', titlestring,... %[output:7655ffe7]
    'silent', true,'ax',Ax(2)); %[output:7655ffe7]
set(fig,'Position',[0 0 2400 1000]); %[output:7655ffe7]
set(Ax(1),'FontSize',18); %[output:7655ffe7]
set(Ax(2),'FontSize',18); %[output:7655ffe7]
%%
% Generate .win & wt.in
init_v2w(1,[-6,6],'check',1,'Projector_list',[1,1,1],'BandIndex',[7,7+6*3+1]); %[output:0ab8aff0] %[output:81093d5f] %[output:00fa5ca1]
selectbands(EIGENCAR,eye(3),'dis_check','BandIndex',[7,7+6*3-1]) %[output:7b94adb9] %[output:3240317d]
cd ..
%%
%[text] wannier
%[text] ![](text:image:59f7)
%[text] shift FermiEnergyÔºÅ/
cd Wan/
Hr_Te = HR.from_wannier90();
Hr_Te.Rm = POSCAR_read;
[Hr_Te.orbL,Hr_Te.elementL, Hr_Te.quantumL] = wout_read;
EIGENCAR_wan = Hr_Te.EIGENCAR_gen()-0.02; %[output:61fae62a]
[fig,Ax] = Figs(1,2); %[output:851d0c65]
bandplot({EIGENCAR,EIGENCAR_wan},Ecut,'Color',[0 0 1;1 0 0],'legends',["DFT","WAN"],'ax',Ax(1)); %[output:851d0c65]
bandplot({EIGENCAR,EIGENCAR_wan},[-1,1],'Color',[0 0 1;1 0 0],'legends',["DFT","WAN"],'ax',Ax(2)); %[output:851d0c65]
set(fig,'Position',[0 0 2400 1000]); %[output:851d0c65]
set(Ax(1),'FontSize',32); %[output:851d0c65]
set(Ax(2),'FontSize',32); %[output:851d0c65]


cd ..
%%
% [H_soc_full, lambda_syms] = soc_term_udud_add(Hr_Te.elementL, Hr_Te.quantumL,'mode','basis');
% 
% H_soc_full
%%
BasisFunction = BasisFunc(Hr_Te) %[output:969dd4eb]
%[text] ![](text:image:1631)
C3_  = Oper.rotation(1/3,[0,0,1],false,'t',[0 0 1/3],'sym',0) %[output:0dd73bd1]
C2_y = Oper.rotation(1/2,[1,0,0],false,'t',[0 0 2/3],'sym',0) %[output:69b7f652]
T = Oper.time_reversal(3) %[output:1c701257]
Gen = [C3_,C2_y,T ];
G = Gen.generate_group %[output:38c18ff6]
for i = 1:numel(Gen)
    if isnan(Gen(i).U)
        Gen(i) = Gen(i).attachRm(Hr_Te.Rm);
        try
            Gen(i).U = BasisFunction.rotation('Oper',Gen(i),'Rm',Hr_Te.Rm);
        catch
            error('fail to generate Oper matrix!');
        end
    end
end
Gen(1) %[output:06439a5b]
Gen(2) %[output:25a30260]
det(Gen(2).U) %[output:9adecb9d]
Gen(3) %[output:24b09301]
%%
Hr_Te_list = Hr_Te.rewrite() %[output:3397b194]
Hr_Te_list = Hr_Te_list.simplify %[output:0ba7a939]
%%
cd Wan/
%%
tic;
Hr_Te_sym = Hr_Te_list.applyOper(Gen,"generator",1) %[output:49500a94] %[output:83ff6118]
toc; %[output:0ae6f249]
%[text] 4\.22 Mb  - 8 min
%%
EIGENCAR_wan2 = Hr_Te_sym.EIGENCAR_gen()-0.02; %[output:6974c6b9]
[fig,Ax] = Figs(1,2); %[output:4c9c1929]
bandplot({EIGENCAR,EIGENCAR_wan},[-1,1],'Color',[0 0 1;1 0 0],'legends',["DFT","WAN"],'ax',Ax(1),'title','Before'); %[output:4c9c1929]
bandplot({EIGENCAR,EIGENCAR_wan2},[-1,1],'Color',[0 0 1;1 0 0],'legends',["DFT","WAN"],'ax',Ax(2),'title','After: Sym By TBkit'); %[output:4c9c1929]
set(fig,'Position',[0 0 2400 1000]); %[output:4c9c1929]
set(Ax(1),'FontSize',32); %[output:4c9c1929]
set(Ax(2),'FontSize',32); %[output:4c9c1929]


